import { Route, Switch,Redirect } from "react-router-dom";
import AllQuotes from "./pages/AllQuotes";
import QuoteDetails from "./pages/QuoteDetails";
import NewQuote from "./pages/NewQuote";

function App() {
  return (
    <div>
      <Layout>
        <Switch>
          <Route path="/" exact><Redirect to="/quotes"></Redirect></Route>
          <Route path="/quotes" exact><AllQuotes></AllQuotes></Route>
          <Route path="/quotes/:quoteId"><QuoteDetails></QuoteDetails></Route>
          <Route path="/new-quote"><NewQuote></NewQuote></Route>
        </Switch>
      </Layout>
    </div>
  );
}

export default App;
